import { AfterViewInit, Component, ElementRef, HostListener, OnInit, ViewChild } from '@angular/core';

@Component({
  selector: 'jhi-pdf-view',
  templateUrl: './pdf-view.component.html',
  styleUrls: ['./pdf-view.component.scss'],
})
export class PdfViewComponent implements OnInit, AfterViewInit {
  @ViewChild('viewer') viewer: ElementRef | undefined;
  base64: any =
    '';
  content: any;
  constructor() {}

  ngOnInit(): void {}

  ngAfterViewInit(): void {}

  fileChangeEvent(event: any): void {
    const selectedFile = event.target.files;
    this.content = selectedFile[0];
    // if(this.content) {
    //
    // }
  }
  @HostListener('document:mousemove', ['$event'])
  onMouseMove(e: any): void {
    const x = e.pageX + 2;
    const y = e.pageY;
    // (document.querySelector('#rectMove') as HTMLElement).style.transform = 'translate(10px, 0px)'
    (document.querySelector('#rectMove') as HTMLElement).style.transform;
  }
}
